import React, { useState, useEffect } from 'react';
import { getTeacherEvaluation } from '../../services/studentApi';
import { toast } from 'react-hot-toast';

const TeacherEvaluation = () => {
  const [evaluations, setEvaluations] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchEvaluations = async () => {
      try {
        const response = await getTeacherEvaluation();
        setEvaluations(response.data);
      } catch (error) {
        console.error('Error fetching evaluations:', error);
        toast.error('Failed to load teacher evaluations');
      } finally {
        setLoading(false);
      }
    };

    fetchEvaluations();
  }, []);

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-screen">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-emerald-500"></div>
      </div>
    );
  }

  return (
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      <div className="bg-white shadow-sm rounded-lg">
        <div className="px-4 py-5 sm:p-6">
          <h1 className="text-2xl font-semibold text-gray-900 mb-6">
            Teacher Evaluations
          </h1>

          {evaluations.length === 0 ? (
            <div className="text-center py-12">
              <p className="text-gray-500">No evaluations available yet.</p>
            </div>
          ) : (
            <div className="space-y-6">
              {evaluations.map((evaluation, index) => (
                <div
                  key={index}
                  className="bg-white border border-gray-200 rounded-lg p-6"
                >
                  <div className="flex items-center justify-between mb-4">
                    <div>
                      <h3 className="text-lg font-medium text-gray-900">
                        {evaluation.title}
                      </h3>
                      <p className="text-sm text-gray-500">
                        Evaluated by: {evaluation.teacher_name}
                      </p>
                      <p className="text-sm text-gray-500">
                        Date: {new Date(evaluation.date).toLocaleDateString()}
                      </p>
                    </div>
                    <span className={`px-3 py-1 rounded-full text-sm font-medium ${
                      evaluation.status === 'completed' 
                        ? 'bg-green-100 text-green-800'
                        : 'bg-yellow-100 text-yellow-800'
                    }`}>
                      {evaluation.status}
                    </span>
                  </div>

                  {/* Academic Performance */}
                  <div className="mt-4 border-t border-gray-200 pt-4">
                    <h4 className="text-sm font-medium text-gray-900 mb-2">
                      Academic Performance
                    </h4>
                    <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                      {evaluation.academic_scores?.map((score, idx) => (
                        <div key={idx} className="flex items-center justify-between">
                          <span className="text-sm text-gray-600">{score.name}</span>
                          <span className="text-sm font-medium text-gray-900">
                            {score.value}/10
                          </span>
                        </div>
                      ))}
                    </div>
                  </div>

                  {/* Professional Skills */}
                  <div className="mt-4 border-t border-gray-200 pt-4">
                    <h4 className="text-sm font-medium text-gray-900 mb-2">
                      Professional Skills
                    </h4>
                    <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                      {evaluation.professional_scores?.map((score, idx) => (
                        <div key={idx} className="flex items-center justify-between">
                          <span className="text-sm text-gray-600">{score.name}</span>
                          <span className="text-sm font-medium text-gray-900">
                            {score.value}/10
                          </span>
                        </div>
                      ))}
                    </div>
                  </div>

                  {/* Comments */}
                  {evaluation.comments && (
                    <div className="mt-4 border-t border-gray-200 pt-4">
                      <h4 className="text-sm font-medium text-gray-900 mb-2">
                        Teacher's Comments
                      </h4>
                      <p className="text-gray-700 whitespace-pre-line">
                        {evaluation.comments}
                      </p>
                    </div>
                  )}

                  {/* Areas for Improvement */}
                  {evaluation.improvements && (
                    <div className="mt-4 border-t border-gray-200 pt-4">
                      <h4 className="text-sm font-medium text-gray-900 mb-2">
                        Areas for Improvement
                      </h4>
                      <ul className="list-disc list-inside text-gray-700 space-y-1">
                        {evaluation.improvements.map((improvement, idx) => (
                          <li key={idx}>{improvement}</li>
                        ))}
                      </ul>
                    </div>
                  )}

                  {/* Final Grade */}
                  {evaluation.final_grade && (
                    <div className="mt-4 border-t border-gray-200 pt-4">
                      <div className="flex items-center justify-between">
                        <h4 className="text-lg font-medium text-gray-900">
                          Final Grade
                        </h4>
                        <span className="text-2xl font-bold text-emerald-600">
                          {evaluation.final_grade}
                        </span>
                      </div>
                    </div>
                  )}
                </div>
              ))}
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default TeacherEvaluation;
